import React from 'react';
import Section from '../layouts/Section';
import PatientsCount from '../components/PatientsCount';
import CardAbout from '../components/CardAbout';

export default function Home() {
  return (
    <div className="flex flex-col items-center space-y-12 lg:space-y-20 px-4 lg:px-0">
      <div className="w-full">
        <Section />
      </div>
      <div className="w-full">
        <PatientsCount />
      </div>
      <div className="w-full max-w-screen-lg">
        <CardAbout />
      </div>
      <div className="container mx-auto w-[1146px] h-[455px] relative">
  <h1 className="title text-center text-[#444444] text-[50px] font-medium leading-[60px]">How it Works</h1>
  <p className="subtitle text-center text-[#878787] text-lg leading-[21px] mt-[10px]">
    We have been providing great flooring solutions service.
  </p>
  <div className="steps flex justify-between mt-[50px]">
    {[
      { step: "01", title: "Create Account", description: "Latter person am secure of estate genius at." },
      { step: "02", title: "Search Doctor", description: "Latter person am secure of estate genius at." },
      { step: "03", title: "Schedule Appointment", description: "Latter person am secure of estate genius at." },
      { step: "04", title: "Start Consultation", description: "Latter person am secure of estate genius at." }
    ].map(({ step, title, description }, index) => (
      <div key={index} className="step-card relative w-[264px] h-[264px] bg-white shadow">
        <div className={`underline absolute bottom-0 w-full h-1 ${index === 0 ? 'bg-[#0594ff]' : 'bg-[#dcdcdc]'}`}></div>
        <div className="step-number absolute left-8 top-8 text-[#444444] text-[100px] font-extrabold opacity-5 leading-[130px]">
          {step}
        </div>
        <h2 className="step-title absolute left-8 top-[84px] text-[#444444] text-[28px] font-semibold leading-9">
          {title}
        </h2>
        <p className="step-description absolute left-8 top-[168px] text-[#878787] text-lg leading-[21px]">
          {description}
        </p>
      </div>
    ))}
  </div>
</div>

    </div>
  );
}
